import '../../App.css';
import '../header.css'
class Header extends Component {
    render(){
        return(
            <div class="header">
            <a class="logo">CompanyLogo</a>
            <div class="header-right">
            <a href="/">Visualisez les donnees</a>
              <a class="active">Home</a>
             
            </div>
          </div>
        )
    }
}


export default Header;
